import './App.css';
import { Header, CollectionCard } from './components';
import { assets } from './constants';
import { useState, useEffect } from 'react';
import axios from 'axios';

//yarn add axios

function App() {
  const [punkListData, setPunkListData] = useState([]);

  useEffect(() => {
    const getMyNfts = async () => {
      const openseaData = await axios.get(
        'https://testnets-api.opensea.io/assets?asset_contract_address=0xCd9c3e23CfEa4e8012BE0353B5729B5b0767f53a'
      );
    };
  }, []);
  return (
    <div className='app'>
      <Header />
      <CollectionCard
        id={0}
        name={'Bandana Punk'}
        traits={[{ value: 7 }]}
        image='https://testnets.opensea.io/collection/cp-punks-r28as8vaws'
      />
    </div>
  );
}

export default App;
